                       ('8f07f63a-3ee5-4f32-a282-dc0d3b38bfe4','RatePlanManager','7e012f1b-43b1-4462-bdbe-bbb1c7b735c7','{"$type":"Vanrise.Entities.VRNamespaceItemSettings, Vanrise.Entities","Code":{"$type":"Vanrise.Common.MainExtensions.VRDynamicCode.CustomCodeDynamicCodeSettings, Vanrise.Common.MainExtensions","ConfigId":"bdd289df-573c-44a1-9a95-d0de2ed9dd71","CustomCode":"public class RatePlanManager\n{\n\tpublic CalculateRatePlanServicesPricingOutput CalculateRatePlanServicesPricing(CalculateRatePlanServicesPricingInput input)\n\t{\n\t\tvar genericBEManager = new Vanrise.GenericData.Business.GenericBusinessEntityManager();\n\t\t\n\t\tvar filterGroup = new Vanrise.GenericData.Entities.RecordFilterGroup { Filters = new List<Vanrise.GenericData.Entities.RecordFilter>() };\n\t\tfilterGroup.Filters.Add(new Vanrise.GenericData.Entities.ObjectListRecordFilter \n\t\t{\n\t\t\tFieldName = \"RatePlan\",\n\t\t\tValues = new List<Object> { input.RatePlanId },\n\t\t\tCompareOperator = Vanrise.GenericData.Entities.ListRecordFilterOperator.In\n\t\t});\n\t\t\n\t\tvar neededColumns = new List<string> { \"Service\", \"ActivationFee\", \"RecurringFee\", \"SuspensionCharge\", \"Deposit\", \"BankGuarantee\", \"AdvancedPaymentNbBillingCycles\" };\n\t\tvar servicesEntities = genericBEManager.GetAllGenericBusinessEntities(new Guid(\"435bba40-1865-413c-9af3-21c0555d9cef\"), neededColumns, filterGroup);\n\t\t\n\t\tvar output = new CalculateRatePlanServicesPricingOutput();\n\t\t\n\t\tif(servicesEntities != null)\n\t\t{\n\t\t\tforeach(var serviceEntity in servicesEntities)\n\t\t\t{\n\t\t\t\tif(input.ServiceIds.Contains(new Guid(serviceEntity.FieldValues[\"Service\"].ToString())))\n\t\t\t\t{\n\t\t\t\t\toutput.TotalActivationFee += CalculateCharge(serviceEntity, \"ActivationFee\");\n\t\t\t\t\toutput.TotalSuspensionFee += CalculateCharge(serviceEntity, \"SuspensionCharge\");\n\t\t\t\t\toutput.TotalDeposit += CalculateCharge(serviceEntity, \"Deposit\");\n\t\t\t\t\toutput.TotalBankGuarantee += CalculateCharge(serviceEntity, \"BankGuarantee\");\n\t\t\t\t\tvar advancedPaymentNbBillingCyclesAsObj = serviceEntity.FieldValues[\"AdvancedPaymentNbBillingCycles\"];\n\t\t\t\t\tif(advancedPaymentNbBillingCyclesAsObj != null)\n\t\t\t\t\t{\n\t\t\t\t\t\tint advancedPaymentNbBillingCycles = (int)advancedPaymentNbBillingCyclesAsObj;\n\t\t\t\t\t\tif(advancedPaymentNbBillingCycles > 0)\n\t\t\t\t\t\t{\n\t\t\t\t\t\t\toutput.TotalPaymentInAdvance += advancedPaymentNbBillingCycles * CalculateCharge(serviceEntity, \"RecurringFee\");\n\t\t\t\t\t\t}\n\t\t\t\t\t}\n\t\t\t\t}\n\t\t\t}\n\t\t}\t\t\n\t\t\n\t\treturn output;\n\t}\n\t\n\tDecimal CalculateCharge(Vanrise.GenericData.Entities.GenericBusinessEntity serviceEntity, string chargeFieldName)\n\t{\n\t\tvar charge = serviceEntity.FieldValues[chargeFieldName];\t\t\t\t\n\t\tif(charge != null)\n\t\t{\n\t\t\tvar chargeValue = charge.CastWithValidate<Retail.BusinessEntity.Entities.RetailBEChargeEntity>(\"charge\")?.Settings?.CalculateCharge(null);\n\t\t\tif(chargeValue.HasValue)\n\t\t\t\treturn chargeValue.Value;\n\t\t}\t\n\t\treturn 0;\n\t}\n}\n\npublic class CalculateRatePlanServicesPricingInput\n{\n\tpublic int RatePlanId {get; set;}\n\t\n\tpublic List<Guid> ServiceIds {get; set;}\n}\n\npublic class CalculateRatePlanServicesPricingOutput\n{\n\tpublic Decimal TotalActivationFee {get; set;}\n\n\tpublic Decimal TotalSuspensionFee {get; set;}\n\t\n\tpublic Decimal TotalDeposit {get; set;}\n\t\n\tpublic Decimal TotalPaymentInAdvance {get; set;}\n\t\n\tpublic Decimal TotalBankGuarantee {get; set;}\n}"}}',-1,'2019-06-19 22:43:04.317',-1,'2019-06-24 17:31:39.940')
